import React from 'react';

export default function getList() {
    
    try {
        fetch(urlAPI)
            .then(response => {
                if (!response.ok) {
                    throw new Error();
                }
                return response;
            });
            
    } catch {
        throw new Error('Something went wrong')
    };
};
